import React from 'react';
import LogoImage from '../assets/Logo Escrito 2 Branco PNG.png'; // Importe a imagem aqui
import Icon1 from '../assets/u'; // Importe o primeiro ícone aqui
import '../styles/Header.css'; // Importe o arquivo CSS diretamente

function Header() {
    return (
        <main>
            <nav className="menu-principal">
                <div className="menu-links">
                    <img src={LogoImage} alt="Logo" className="logteste" />
                    {/* Adicione os ícones abaixo */}
                    <div className="icon-container">
                    <img src={Icon1} alt="Icon 1" className="icon" />
                    <img src={Icon1} alt="Icon 2" className="icon" />
                    </div>
                </div>
            </nav>
        </main>
    );
}

export default Header;
